    false,nt"url": null,nt"notes": "This narrative report for Fort Peck NWR
    outlines Refuge accomplishments from November, 1941 through January, 1942. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    rodents, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments. Resource management is outlined; topics include
    grazing and timber removal. The public relations section of the report describes
    recreational uses. Photographs are attached.",nt"license_title": "License
